  [],\n\t\"revision_timestamp\": \"2016-07-27T23:06:18.478974\",\n\t\"name\": \"climate-change-planning-for-the-great-plains-wildlife-vulnerability-assessment-recommendat\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report is the Great Plains Landscape
  Conservation Cooperative (GP LCC) Vulnerability Assessment Report The purpose of
  the  GP LCC is to conduct applied science and make that information accessible to
  on-the-ground the managers to help the community of decision-makers in the GP LCC
  understand how to approach landscape-scale management in light of stressors such
  as climate change. To address this need, we executed a short term project for the
  GP LCC to assess the vulnerability of grassland-dependent wildlife to climate change
  impacts in the GP LCC geography with the following as deliverables: 1) Vulnerability
  assessments for key grassland wildlife; 2) Workshop of experts for a climate change
  adaptation planning exercise; and 3) Summary report and draft outreach materials.
  \ Given this shared level of vulnerability to climate change, we chose to focus
  our adaptation planning on grassland birds as they represent a large group with
  a diversity of habitat needs. These birds are obligate grassland wildlife species
  which have great potential to act as indicators for habitat quality since different
  species have distinct habitat structure needs.\",\n\t\"license_title\": \"License
